    const parameters = {
      [ParameterId.ParameterFieldName]: fieldName,
      [ParameterId.ParameterValue]: newValue
    };

    return this.execute(VerbId.ChangeParameterValue, parameters).then(response => {
      const result = response.result as ParameterInfo;
      return result;
    });
  }

  public findParameterByNameAsync(name: string, sheet: Contract.Sheet): Promise<Parameter | undefined> {
    return this.findParameterAsync(sheet, name, undefined);
  }

  public findParameterByGlobalFieldNameAsync(fieldName: string, sheet: Contract.Sheet): Promise<Parameter | undefined> {
    return this.findParameterAsync(sheet, undefined, fieldName);
  }

  private findParameterAsync(
    sheet: Contract.Sheet,
    name: string | undefined,
    fieldName: string | undefined): Promise<Parameter | undefined> {
    const parameters: ExecuteParameters = {};
    if (name !== undefined) {
      parameters[ParameterId.ParameterCaption] = name;
    } else if (fieldName !== undefined) {
      parameters[ParameterId.ParameterFieldName] = fieldName;
    } else {
      throw new TableauError(Contract.ErrorCodes.InvalidParameter, 'name or fieldName must be provided to find parameter');
    }

    return this.execute(VerbId.FindParameter, parameters).then(response => {
      const instanceOfParameterInfo = (object: Model): object is ParameterInfo => {
        return 'fieldName' in object;
      };

      // We need to check to see if we got a valid response back again
      if (instanceOfParameterInfo(response.result)) {
        const result = response.result as ParameterInfo;
        const impl = new ParameterImpl(result);
        return new Parameter(impl, sheet);
      } else {
        return undefined;
      }
    });
  }
}



